import { Outlet } from "react-router-dom";
import Registration from "../../modals/Registration/Registration";

const Header = () => {
  return <>
    <div>HEADER</div>
    <div className="header">
      <span className="header_title">Header</span>
      <Registration />
    </div>
    <Outlet />
  </>

};

export default Header;
